from flask import Flask, render_template
from flask import request


server = Flask(__name__)


@server.route('/')
def main():
    if not request.headers.getlist("X-Forwarded-For"):
        ip = request.remote_addr
    else:
        ip = request.headers.getlist("X-Forwarded-For")[0]
    return render_template('base.html', ip=ip)

@server.route('/bad_ip/')
def bad_ip():
    page = """<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <title>Title</title>
</head>
<body style="background: url('data:image/jpeg;base64,') no-repeat; background-size: cover;">
</body>
</html>"""
    return page

server.run(debug=None, host='0.0.0.0', port='8000', threaded=True)
